'
    .modal-body{
        .modal-header{
            text-align: center;
            display:flex;
            width:100%;
            justify-content:center;
            padding-bottom:20px;
            .modal-title{
                font-size: 60px;
                font-weight: 400;
                font-family: "Raleway", sans-serif;
                margin: 0 auto;
                width:100%;
                line-height: 1.2;
                color: #252525;
                @media(max-width:768px){
                    font-size:40px;
                }
            }
        }

        form{
            padding: 50px 10px;
            -webkit-box-shadow: 0 0 15px rgb(0 0 0 / 15%);
            box-shadow: 0 0 15px rgb(0 0 0 / 15%);
            .form-group{
                position: relative;
                padding: 15px 0 0;
                margin: 30px;
                .form-label{
                    position: absolute;
                    top: 0;
                    display: block;
                    transition: 0.2s;
                    font-size: 1rem;
                    color: #9b9b9b;
                }
                .form-field{
                    font-family: inherit;
                    width: 100%;
                    border: 0;
                    border-bottom: 2px solid #9b9b9b;
                    outline: 0;
                    font-size: 1.3rem;
                    /* color: #fff; */
                    padding: 7px 0;
                    background: transparent;
                    transition: border-color 0.2s;
                    ::placeholder {
                        color: transparent;
                    }
                    :placeholder-shown ~ .form-label {
                        font-size: 1.3rem;
                        cursor: text;
                        top: 20px;
                    }
                    :focus {
                        padding-bottom: 6px;
                        font-weight: 700;
                        border-width: 3px;
                        border-image: linear-gradient(to right, #11998e, #38ef7d);
                        border-image-slice: 1;
                        outline:none;
                    }
                    :focus::placeholder {
                        color: #D2D2D2;
                        font-size: 400;
                      }
                      :focus ~ .form-label {
                        position: absolute;
                        top: 0;
                        display: block;
                        transition: 0.2s;
                        font-size: 1rem;
                        color: #11998e;
                        font-weight: 700;
                      }
                      :required,:invalid {
                        box-shadow: none;
                      }
                }
                .rating{
                    -webkit-appearance: none;
                    width: 100%;
                    height: 25px;
                    background: #d3d3d3;
                    outline: none;
                    opacity: 0.7;
                    padding: 0px;
                    margin: 20px 0px;
                    -webkit-transition: .2s;
                    transition: opacity .2s;
                    :hover{
                      opacity: 1;
                    }
                    :focus ~ .form-label {
                        position: absolute;
                        top: 0;
                        display: block;
                        transition: 0.2s;
                        font-size: 1rem;
                        color: #11998e;
                        font-weight: 700;
                      }
                    ::-webkit-slider-thumb {
                        -webkit-appearance: none;
                        appearance: none;
                        width: 25px;
                        height: 25px;
                        background: #04AA6D;
                        cursor: pointer;
                      }
                      ::-moz-range-thumb {
                        width: 25px;
                        height: 25px;
                        background: #04AA6D;
                        cursor: pointer;
                      }
                }
            }
        }  
        ::-webkit-scrollbar {
            width: 5px;
          }
          ::-webkit-scrollbar-track {
            background: #cecece;
          }
          ::-webkit-scrollbar-thumb {
            background: #888;
          }
          ::-webkit-scrollbar-thumb:hover {
            background: #555;
          }
    }
'

